import React from 'react';
import { NavLink, Route } from 'react-router-dom';

const Nav = ({match}) => {
    return (
        <nav className="main-nav">
            <ul>
                {/* <li><a href="#">Dogs</a></li>
                <li><a href="#">Food</a></li>
                <li><a href="#">Travel</a></li> */}
                <li><NavLink to={`${match.url}/food`}>Food</NavLink></li>
                <li><NavLink to={`${match.url}/beaches`}>Beaches</NavLink></li>
                <li><NavLink to={`${match.url}/sunset`}>Sunset</NavLink></li>
            </ul>
        </nav>  
    )
}

export default Nav;
